import React from 'react';
import styles from "./Form.module.scss";
import cx from 'classnames';
import axios from 'axios';

const API = 'http://127.0.0.1:8000/api/order/'


const Form = () => {


  const handleSubmit = (e) => {
    e.preventDefault();
    sendRequest();
  }

  const sendRequest = () => {
    axios.post(API, {
      name: 'Fred',
      phone: '89031112345',
      address: 'Москва, ООО',
      status: false
    })
      .then(function (response) {
        console.log(response);
      })
      .catch(function (error) {
        console.log(error);
      });
  }



  return (
    <form className={styles.form} onSubmit={handleSubmit}>
      <input type="text" placeholder={"Имя"} name="name" id="name" />
      <input type="tel" placeholder={"Телефон"} name="phone" id="phone" />
      <input type="text" id="input1" placeholder={"Адрес"} readOnly={true} name="address" />
      <div className={styles.form__btns}>
        <button className={styles.btn} type={'submit'}>Отправить запрос</button>
        <button className={cx(styles.btn, styles.btn_reset)} type={'reset'}>Очистить</button>
      </div>
    </form>
  )
};


export default Form;
